import { useEffect, useRef } from "react"
import { gsap } from "gsap"
import "./TestBed.css"
import * as THREE from "three";
import { SVGLoader } from "three/examples/jsm/loaders/SVGLoader";
import { GUI, GUIController } from 'dat.gui'

export default function TestBed(){
    const scene = new THREE.Scene();
    scene.background = new THREE.Color( 0xff0000 )
    const camera = new THREE.PerspectiveCamera( 75, window.innerWidth / window.innerHeight, 0.1, 1000 );
    camera.position.y = 0
    camera.position.z = 6;
    const renderer = new THREE.WebGLRenderer();
    renderer.setSize( window.innerWidth, window.innerHeight );
/*     const geometry = new THREE.BoxGeometry( 1, 1, 1 );
    const material = new THREE.MeshBasicMaterial( { color: 0x00ff00 } );
    const cube = new THREE.Mesh( geometry, material );
    scene.add( cube ); */
    
    let ambientLight = new THREE.AmbientLight(0xffffff, 1);
    let directionalLight = new THREE.DirectionalLight(0xffffff, 1)
    scene.add(ambientLight);
    scene.add(directionalLight);
    
    const renderScene = () => {
        renderer.render(scene, camera)
    }
    const onCameraXChange = (cameraX:number) =>{
        camera.position.x = cameraX
        renderScene()
    }
    const onMountainRotate = () => {
        renderScene()
    }
    
    const onLoad = (texture: THREE.Texture) => {
        console.log('hey it loaded')
        const mat = new THREE.MeshPhongMaterial({map:texture, transparent:true})
        let mountainPlane:THREE.PlaneGeometry = new THREE.PlaneGeometry(18,1.5)
        let mountianMesh = new THREE.Mesh( mountainPlane, mat);
        mountianMesh.position.z = -5
        scene.add(mountianMesh)

        const gui = new GUI()
        const mountainFolder = gui.addFolder('mountain')
        mountainFolder  .add(mountianMesh.rotation, 'x', 0, Math.PI * 2)
                        .name('Rotate X')
                        .listen().onChange(onMountainRotate)
        
        
        mountainFolder  .add(mountianMesh.rotation, 'y', 0, Math.PI * 2)
                        .name('Rotate Y')
                        .listen()
                        .onChange(onMountainRotate)

        mountainFolder  .add(mountianMesh.rotation, 'z', 0, Math.PI * 2)
                        .name('Rotate Z')
                        .listen()
                        .onChange(onMountainRotate)

        mountainFolder.open()
        const cameraFolder = gui.addFolder('Camera')
        cameraFolder.add(camera.rotation, 'y', Math.PI / -4, Math.PI / 4)
            .name('Camera Y')
            .listen()
            .onChange(onCameraXChange)
        cameraFolder.open()


        renderScene()
    }
    const onProgress = (event: ProgressEvent<EventTarget>) => {
        console.log('onProgress', event.loaded/event.total)
    }
    const onError = (event: ErrorEvent) => {
        console.log('error', event.error)
    }
    const loadMaterial = () => {
        console.log('loading material')
        const mountainCode:string = 'data:image/png;base64,' 
        var textureLoader = new THREE.TextureLoader();
        textureLoader.load(mountainCode, onLoad, onProgress, onError);
    }
    useEffect(
        ()=>{
            console.log('useeffect')
            document.getElementById('testbed-inner')!.appendChild( renderer.domElement );
            //camera.rotation.set(0,1,0)
            camera.lookAt(1,0,1)
            renderScene()
            
        } 
    )
    loadMaterial()
    return  <div id="testbed-container">
                <div id="testbed-inner"/>
            </div>
}